import randomDiceRoll from '../../diceroll/diceroll';

// fielder rolls die for strength of throw towards a base

const fielder = () => {
	const result = {
		defenseType: 'fielder',
		text: `Fielder throws a ${result}`,
		roll: randomDiceRoll()
	};
	return result;
};

export default fielder;
